import React from 'react'

export default class NavigationBar extends React.Component {

    setLeague(event) {
        console.log(event);
    }

    render() {
        return(
            <div className='nav-bar'>
                <input type='radio' value='Ligue 1' name='league' id='radio-ligue1'/>
                <label htmlFor='radio-ligue1' onClick={this.setLeague()}>Ligue 1</label>
                <input type='radio' value='Premier League' name='league' id='radio-premierleague'/>
                <label htmlFor='radio-premierleague'>Premier League</label>
                <input type='radio' value='Bundesliga' name='league' id='radio-bundesliga'/>
                <label htmlFor='radio-bundesliga'>Bundesliga</label>
            </div>
        )
    }
}
